scriptlet.script:
if (scriptletInput !== null) {
  var ent=scriptletInput.split("\n");
  var salida="";
  var acum=0;
  var count=0;
  for(i=0;i<ent.length;i++){
  	acum+=parseFloat(ent[i].split(",")[12]);
  	count++;
  }
  salida+= "Cantidad de TRX: "+count+"   Acumulado: "+acum;
  scriptletResult=salida;
  scriptletContext.put("TransitoAyerCount",count);
  scriptletContext.put("TransitoAyerAcum",acum);
}

